  Locations Collected in March/April 2014 and October 2014 from Chincoteague Bay,
  Virginia and Maryland (U.S. Geological Survey Field Activity Numbers 14CTB01, and
  14CTB22)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
